import style from './Product.module.css';

const ProductItem = ({title}) => {
    return (
        <div className={style['product-card']}>
            <div className={style['prd-img']}></div>
            
            <div className={style['prd-info']}>
            <p className={style['prd-title']}>{title}</p>
                <p className={style['prd-description']}>Гель для тела для похудения</p>
                <div className={style['prd-buy']}>
                    <p className={style['prd-price']}>69.99 руб</p>
                    <div className={style['prd-cart']}></div>
                </div>
            </div>
        </div>
    )
}
export default ProductItem;
